package song.common.toolkit.pdm;import java.util.List;/** * description: * author:          song * createDate:      2017/10/25 */public class PdmKey {    private String id;    private String objectID;    private String name;    private String code;    private List<PdmKeyColumn> columns;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public List<PdmKeyColumn> getColumns() {        return columns;    }    public void setColumns(List<PdmKeyColumn> columns) {        this.columns = columns;    }    public String getObjectID() {        return objectID;    }    public void setObjectID(String objectID) {        this.objectID = objectID;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }}